import './App.css';
import { React } from 'react';

function App() {
  return (
    <>
      <div className="bg-green-300 h-20 flex justify-center text-4xl py-2">Chat-App</div>
      <div className="h-40 my-3 flex justify-center">
        <form action="">
          <fieldset className='border-4 border-double border-purple-900 h-96 w-96'>
            <legend className='flex mx-auto'>LOGIN DETAILS</legend>
            <label htmlFor="name_id" className='ml-10 mt-4'>Username</label> <br />
            <input className='h-10 ml-2 mt-4 border-4 border-gray' type="text" id="name_id" placeholder='Enter your Username' />
            <br />
            <label htmlFor="number_id">Password</label> <br />
            <input className='h-10 mt-2 border-4 border-gray' type="password" name="number_name" id="number_id" placeholder='Enter your Password' />
            <br />
            <input type="button" value="Log" className='bg-blue-600' />
          </fieldset>
        </form>
      </div>
    </>
  );
}

export default App;
